import React, { Component } from "react";
class ShowDate extends Component {
    render() {
        state = {
            form_redirect: false,
        }
        //   console.log("ShowData renders")
        return (
            <div key={new Date()}>
                <h1>{this.props.name}</h1>
                <button onClick={() => { this.setState({ form_redirect: true }) }}> + New</button>
            </div>
        );
    }
}
export default (ShowDate);
